body,h11{color:#fff}#sortBy-container,.message,.timer,footer,h11{text-align:center}#sortBy,.cell,.restart-btn,.username-btn{cursor:pointer}.message,.ticktoe-cell,footer a{font-weight:700}body{font-family:Roboto,sans-serif;background:linear-gradient(135deg,#6a11cb,#2575fc);display:flex;flex-direction:column;justify-content:center;align-items:center;min-height:100vh;margin:0;padding:0}h11,h2{font-family:Times New Roman}h11{font-size:16px;margin-bottom:15px}.board{display:grid;grid-template-columns:repeat(3,1fr);grid-template-rows:repeat(3,1fr);gap:10px;width:400px;height:400px;border:3px solid #00e559;margin-bottom:20px;background:#fff;border-radius:10px;box-shadow:0 8px 16px rgba(0,0,0,.2);padding:10px}.cell{display:flex;justify-content:center;align-items:center;font-size:2.5rem;color:#333;background-color:#f0f0f0;border:2px solid #010091;border-radius:10px;transition:transform .2s,background-color .2s;box-shadow:inset 0 0 5px rgba(0,0,0,.1)}.cell.taken{border:2px solid #6700b4;pointer-events:none;color:#f30000;transition:border .3s,color .3s,transform .2s;transform:scale(1.05)}.message,.timer{font-size:1.2rem;margin-bottom:15px}.message{color:#ff4081}.restart-btn{background-color:#ff4081;color:#fff;border:none;padding:12px 20px;font-size:1rem;border-radius:8px;transition:background-color .3s,box-shadow .3s}.restart-btn:hover{background-color:#c2185b}.restart-btn:active{box-shadow:0 4px 10px rgba(0,0,0,.2);transform:translateY(2px)}@media (max-width:480px){h1{font-size:1.5rem;margin-bottom:10px}.board{width:280px;height:280px;gap:8px;padding:5px}.cell{font-size:2rem}.message,.timer{font-size:1rem}.restart-btn{font-size:.9rem;padding:10px 18px}}footer{color:#fff;font-size:.9rem;opacity:.8;position:flex;bottom:0;left:0;width:100%;padding:10px 0}footer a{color:#80d6ff;text-decoration:none}footer a:hover{text-decoration:underline}h2{font-size:16px}#leaderboard-table{width:90%;border-collapse:collapse;margin-top:20px}#leaderboard-table td,#leaderboard-table th{padding:10px;text-align:center;border:2px solid #00dc47}#username-container{display:flex;flex-direction:column;align-items:center;margin-top:50px;font-family:Arial,sans-serif}.username-label{font-size:1.2rem;color:#333;margin-bottom:10px}.username-input{width:200px;padding:5px;margin-bottom:20px;border:2px solid #00e168;border-radius:8px;font-size:1rem;transition:border-color .3s}.username-input:focus{border-color:#00dc47;outline:0}.username-btn{padding:5px 10px;border:none;background-color:#00dc47;color:#fff;font-size:1rem;border-radius:5px;transition:background-color .3s}.username-btn:hover{background-color:#00a036}#sortBy-container{margin:20px 0;font-family:Arial,sans-serif}#sortBy-container label{font-size:1rem;font-weight:700;color:#fff;margin-right:10px}#sortBy{padding:0;font-size:1rem;background-color:#f2f2f200;border:3px solid #00dc47;border-radius:4px;color:#fff;transition:background-color .3s,border-color .3s}#sortBy option{padding:10px;font-size:1rem}#clearLeaderboardBtn{display:none;padding:5px;margin:20px 0;background-color:#ff4d4d;color:#fff;border:none;border-radius:5px;font-size:1rem;cursor:pointer;transition:background-color .3s,transform .2s}#clearLeaderboardBtn:hover{background-color:#e60000;transform:scale(1.05)}#clearLeaderboardBtn:active{background-color:#c00;transform:scale(.98)}#clearLeaderboardBtn:focus{outline:0;box-shadow:0 0 5px 2px rgba(255,77,77,.5)}#gameStatsChart{color:#fff;width:100%;height:300px;max-width:800px;margin:0;display:block;background-color:#f4f4f400;border-radius:8px;box-shadow:0 4px 6px transparent}.ticktoe-preloader{position:fixed;top:0;left:0;width:100%;height:100%;background:linear-gradient(135deg,#6a11cb,#2575fc);display:flex;flex-direction:column;align-items:center;justify-content:center;z-index:9999}.ticktoe-grid{display:grid;grid-template-columns:repeat(3,60px);grid-gap:10px}.ticktoe-cell{width:60px;height:60px;background-color:#fff;display:flex;align-items:center;justify-content:center;font-size:2rem;color:#3498db;animation:1s ease-in-out infinite fadeIn}.bottom-footer,.ticktoe-footer{font-weight:300;text-align:center}.ticktoe-cell:first-child{animation-delay:0s}.ticktoe-cell:nth-child(2){animation-delay:.2s}.ticktoe-cell:nth-child(3){animation-delay:.4s}.ticktoe-cell:nth-child(4){animation-delay:.6s}.ticktoe-cell:nth-child(5){animation-delay:.8s}.ticktoe-cell:nth-child(6){animation-delay:1s}.ticktoe-cell:nth-child(7){animation-delay:1.2s}.ticktoe-cell:nth-child(8){animation-delay:1.4s}.ticktoe-cell:nth-child(9){animation-delay:1.6s}@keyframes fadeIn{0%,100%{opacity:0}50%{opacity:1}}.ticktoe-footer{margin-top:20px;color:#fff;font-size:1rem;animation:1.5s ease-in-out infinite alternate fadeInFooter}@keyframes fadeInFooter{from{opacity:.5}to{opacity:1}}.bottom-footer{position:absolute;bottom:20px;width:100%;font-size:.8rem;color:#ffffffaa}.content{display:none;padding:20px;text-align:center}.content h1{font-size:2.5rem;color:#333}.content p{font-size:1rem;color:#666}
